INSERT INTO `v1_8f9199e357093312a006a129654df3e8099ec24ff4976fd5031b575b0d97de83` VALUES ("あうぅ～残念さ～\nマジムンに魂を\n奪われちゃったかな～？", 4, 0.0, 110501, 1, "カオリ（サマー）", 24, "2030/12/17 14:59:59", 24015, 10021, 4, 0.0, "2019/07/31 12:00:00", 0.0);
INSERT INTO `v1_8f9199e357093312a006a129654df3e8099ec24ff4976fd5031b575b0d97de83` VALUES ("今日は踊りのキレも悪いよ～\nゴーヤーっぽいもの食べて、元気回復さ～！", 1, 0.0, 110501, 2, "カオリ（サマー）", 24, "2030/12/17 14:59:59", 24016, 10021, 4, 0.0, "2019/07/31 12:00:00", 4.0);
INSERT INTO `v1_8f9199e357093312a006a129654df3e8099ec24ff4976fd5031b575b0d97de83` VALUES ("マジムンだらけで目が回るさ～！\nふらふらさ～！", 4, 0.0, 110501, 3, "カオリ（サマー）", 24, "2030/12/17 14:59:59", 24017, 10021, 4, 0.0, "2019/07/31 12:00:00", 0.0);
INSERT INTO `v1_8f9199e357093312a006a129654df3e8099ec24ff4976fd5031b575b0d97de83` VALUES ("なんくるない、なんくるない\n次、頑張ればいいんだよ～！\n海で泳いで\nリフレッシュするさー！", 2, 0.0, 110501, 4, "カオリ（サマー）", 24, "2030/12/17 14:59:59", 24018, 10021, 1, 0.0, "2019/07/31 12:00:00", 5.2);
INSERT INTO `v1_8f9199e357093312a006a129654df3e8099ec24ff4976fd5031b575b0d97de83` VALUES ("恥ずかしいところ\n見られちゃったね～\n水着？　水着のことじゃないよー？", 6, 0.0, 110501, 5, "カオリ（サマー）", 24, "2030/12/17 14:59:59", 24019, 10021, 5, 0.0, "2019/07/31 12:00:00", 4.2);
INSERT INTO `v1_8f9199e357093312a006a129654df3e8099ec24ff4976fd5031b575b0d97de83` VALUES ("絶好調さ～！　この調子で\n海の平和を取り戻すよ～！\n楽しい夏が待ってるさ～！", 2, 0.0, 110501, 6, "カオリ（サマー）", 24, "2030/12/17 14:59:59", 24020, 10021, 2, 0.0, "2019/07/31 12:00:00", 0.0);
INSERT INTO `v1_8f9199e357093312a006a129654df3e8099ec24ff4976fd5031b575b0d97de83` VALUES ("何匹で襲ってきたって\n私はマブイを落っことさないよ～！\nくしゅん！　あ……\n今のくしゃみで落っこちたかも～？", 6, 0.0, 110501, 7, "カオリ（サマー）", 24, "2030/12/17 14:59:59", 24021, 10021, 1, 0.0, "2019/07/31 12:00:00", 6.4);
INSERT INTO `v1_8f9199e357093312a006a129654df3e8099ec24ff4976fd5031b575b0d97de83` VALUES ("ひーやーさーさー♪\n戦いの後は、踊りを踊って\n気分スッキリさ～！", 2, 0.0, 110501, 8, "カオリ（サマー）", 24, "2030/12/17 14:59:59", 24022, 10021, 2, 0.0, "2019/07/31 12:00:00", 0.0);
INSERT INTO `v1_8f9199e357093312a006a129654df3e8099ec24ff4976fd5031b575b0d97de83` VALUES ("あれ～？　戦ってるうちに\n水着がどっか行っちゃった～？\nねぇキミ、どっかで見なかった～？\nなんで離れるさ～？", 3, 0.0, 110501, 9, "カオリ（サマー）", 24, "2030/12/17 14:59:59", 24023, 10021, 6, 0.0, "2019/07/31 12:00:00", 10.08);
INSERT INTO `v1_8f9199e357093312a006a129654df3e8099ec24ff4976fd5031b575b0d97de83` VALUES ("まだまだ私は元気だよ～！\nマジムンでもなんでも、\nどんとこーいさー♪", 2, 0.0, 110501, 10, "カオリ（サマー）", 24, "2030/12/17 14:59:59", 24024, 10021, 1, 0.0, "2019/07/31 12:00:00", 5.0);
INSERT INTO `v1_8f9199e357093312a006a129654df3e8099ec24ff4976fd5031b575b0d97de83` VALUES ("私の空手は世界最強さ～！\n夏の陽射しと青い海も合わされば、\n向かうところ敵なしだよー！", 2, 0.0, 110501, 11, "カオリ（サマー）", 24, "2030/12/17 14:59:59", 24025, 10021, 2, 0.0, "2019/07/31 12:00:00", 0.0);
